const Section = styled.section`
  justify-conter: center;
  align-item: center;
  display: flex;
  height: 100%;
  width: 100vw;
`;
const ColumnLeft = styled.div`
  padding: 1rem 1rem;
  display: flex;

  flex-direction: column;
  justify-content: center;
  align-items: flex-start;
`;
const ColumnRight = styled.div`
  padding: 5rem 2rem;
  display: flex;
  flex:1
  flex-direction: column;
  justify-content: center;
  align-items: flex-start;
`;

class Home extends Component {
  render() {
    return (
      <Section className="container-fluid bg-light ">
        <div className="container">
          <div class="row">
            <div class="col-8">
              {" "}
              <ColumnLeft clasName="bg-light">
                {" "}
                <motion.figure
                  class="text-center"
                  animate={{ scale: [8, 0.5] }}
                  transition={{ duration: 0.9 }}
                >
                  <h2 class="display-4">Suman Karanjit</h2>
                  <h4 class=" " style={{ color: "#6c757d" }}>
                    Software Developer
                  </h4>
                </motion.figure>
              </ColumnLeft>
            </div>
            <div class="col-4">
              {" "}
              <ColumnRight clasName="bg-light">
                {" "}
                <motion.figure
                  class="text-center"
                  animate={{ scale: [8, 0.5] }}
                  transition={{ duration: 0.9 }}
                >
                  <h2 class="display-4">Suman Karanjit</h2>
                  <h4 class=" " style={{ color: "#6c757d" }}>
                    Software Developer
                  </h4>
                </motion.figure>
              </ColumnRight>
            </div>
          </div>
        </div>
      </Section>
    );
  }
}

export default Home;
